import { useState } from 'react';
import WBK from 'wikibase-sdk';

export default function TornadoTable(prop) {

    const wbk = WBK({ instance: 'http://156.35.98.107:8080' })
    const headers = { 'Accept': 'application/json' };

    //Q23
    var url = wbk.getEntities('Q23')
    var tornado = null;
    var tornados = [];
    const [tornadoss, setTornados] = useState();

    fetch(url, { headers }).then(body => { 
        body.json().then(data => 
            {
                var aux = data.entities.Q23.claims
                tornado = {
                    width: aux['P1'][0].mainsnak.datavalue.value
                }
            }); });

    var tornados = [{ title: '2021', state: 'Ohio' }, { title: '2022', state: 'Texas' }];

    var tornadosToShow = tornados.map(function (tornado) {
        return (
            <tr>
                <td>{tornado.title}</td>
                <td>{tornado.state}</td>
            </tr>
        )
    })

    return (
        <div>
            <div className='container col-md-8'>
                <table className="table table-dark">
                    <thead>
                        <tr>
                            <th scope="col">Nombre</th>
                            <th scope="col">Estado</th>
                        </tr>
                    </thead>
                    <tbody>
                        {tornadosToShow}
                    </tbody>
                </table>
            </div>
        </div>
    )
}
